import React from "react";
import styled from "styled-components";
import Image from "next/image";

const Wrapper = styled.div`
  display: flex;
  width: 100%;
  min-height: 100vh;
`;

const Hero = () => {
  return (
    <Wrapper>
      <Image src='/images/bg.jpg' unsized />
    </Wrapper>
  );
};

export default Hero;
